import React, { useState } from 'react';
import './App.css'; 


function App() {

  const [count, setCount] = useState(1);
  const handleCountUpdate = () => {
    setCount(count + 1);
  }
  return (  
    <div className="App">
      <button onClick={handleCountUpdate}>Update</button>
      <span>count : { count }</span>
    </div>
  );
}
export default App;
